import React from 'react'
import PatientNavBar from '../components/PatientNavBar'
import PatientFooter from '../components/PatientFooter'

const PatientAppointment = () => {
  return (
<div className="profile-container" id="container">
        <PatientNavBar />
        <div className="info-container">
        <iframe
           src="https://calendar.google.com/calendar/embed?height=600&wkst=1&bgcolor=%23ffffff&ctz=Asia%2FManila&src=Y19kZWM3ZTA3NWI0OTBiYWZjNDA1NWVlOGU0ODI3NDcwZGI5ZWVlZmJmMDkyZTJmODMzOTc0ODFjODQwYmU1MDBjQGdyb3VwLmNhbGVuZGFyLmdvb2dsZS5jb20&color=%23EF6C00" 
           style={{ border: 'solid 1px #777', width: '800px', height: '600px' }}
           title="Google Calendar"
        ></iframe>
        </div>
        <PatientFooter />
    </div>
  )
}

export default PatientAppointment;
